conn = psycopg2.connect("dbname=recommendation user=postgres password=ggi2011 port=5432")
cur = conn.cursor()

# create a table in the database with all the fields in store_products items as columns
cur.execute("""
CREATE TABLE IF NOT EXISTS store_products (
    id SERIAL PRIMARY KEY,
    name VARCHAR(100),
    price INTEGER,
    type VARCHAR(100),
    department INTEGER,
    has_car INTEGER,
    has_son INTEGER,
    has_partner INTEGER,
    halls INTEGER,
    has_pet INTEGER,
    age INTEGER,
    gender INTEGER
    );
""")
conn.commit()

# insert all values from store_products into store_products table in the database
for item in store_products:
    postgres_insert_query = """INSERT INTO store_products (name, price, type, department, has_car, has_son, has_partner, halls, has_pet, age, gender) VALUES (%s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s)"""
    record_to_insert = (item["name"], item["price"], item["type"], item["department"], item["has_car"], item["has_son"], item["has_partner"], item["halls"], item["has_pet"], item["age"], item["gender"])
    cur.execute(postgres_insert_query, record_to_insert)
